import React from 'react';

// import Fade from 'react-reveal/Fade';

import BannerStyles from './Banner.module.css'

const banner = () =>{

    return (
        <div id={BannerStyles.banner}>
            <div className={BannerStyles['header-bg']}></div>

            <div id={BannerStyles['banner-content']}>

                {/* <Fade bottom> */}
                    <div id={BannerStyles['picture-side']}>
                        <img src="img/banner/all.png" alt=""/>
                    </div>
                {/* </Fade> */}

                {/* <Fade top> */}
                    <div id={BannerStyles['text-side']}>
                        <p>Computer Engineering <span>Student</span></p>
                        <div id={BannerStyles.bar}></div>
                        <p>With Interests in Web Development, Mobile Development, UI/UX Design and Machine Learning.</p>
                    </div>
                {/* </Fade> */}

            </div>

        </div>
    )
}

export default banner;
